import React from 'react'
import './Sobre.css'

function Sobre() {
  return (
    <div id='Sobre'  className='sobre'>
        <h1 className='titulos'>Sobre mim</h1>
        <p>"Desenvolvedor Web com experiência acadêmica em React.js, JavaScript, Sql server, C# e consumo de APIs REST. Apaixonado pelo desenvolvimento de componentes reutilizáveis. Formado em Análise e Desenvolvimento de Sistemas e cursando Especialização em Front-End na Udemy."</p>
    </div>
  )
}

export default Sobre
